function HomePage() {
  return (
    <div>
      <Header />
      <SearchBar searchQuery={searchQuery} setSearchQuery={setSearchQuery} />
      <Products
        products={products}
        searchQuery={searchQuery}
        onProductClick={handleProductClick}
      />
      {selectedProduct && <ProductDetails product={selectedProduct} />}
      <Footer />
    </div>
  );
}

export default HomePage;
